import countries from 'world-countries'

const CountryInfo = ({ data }) => {
  console.log(data)

  return (
    <div className='country'>
      <p>Country: {countries[0].name.common}</p>
      <p>Area: </p>
    </div>
  )
}

const App = (props) => {
  return (
    <div>
      <CountryInfo data={countries[0]} />
    </div>
  )
}

export default App
